import React from "react";
import "./App.css";
import Blog from "./pages/blog";
import Home from "./pages/home";
import { Route } from "react-router-dom";

const App = () => {
  return (
    <div className="App">
      <Route path="/" component={Home} />
      <Route path="/blog/:id" component={Blog} />
    </div>
  );
};

export default App;
